import { styled } from 'styled-components'

const StyledInput = styled.section`
  background-color: #233945;
  width: 80%;
  color: #FFFFFF;
  box-sizing: border-box;
  height: 60%;
  overflow: hidden;
  display: flex;
  flex-direction: column;
`

const StyledTitle = styled.div`
  font-size: 2em;
  font-weight: bold;
  border-left: 2px solid #345363;
  border-right: 2px solid #345363;
  border-top: 2px solid #345363;
  padding: 10px;
  height: 20%;
`

const StyledText = styled.div`
  fontSize: 1.8em;
  border: 2px solid #345363;
  padding: 10px;
  height: 80%;
`

const Textbox = ({ title, text }) => {
  return (
    <>
      <StyledInput>
        <StyledTitle>{title}</StyledTitle>
        <StyledText>{text}</StyledText>
      </StyledInput>
    </>
  )
}

export default Textbox
